import React, { useState } from "react";

function Test() {
  const [isValid, setIsValid] = useState(true);

  const nameChangeHandler = (event) => {};

  return (
    <div>
      <form>
        <input type="text" onChange={nameChangeHandler}>
          Write Your Name
        </input>
      </form>
    </div>
  );
}

export default Test;
